$(document).ready(function() {
    $.ajaxSetup({
        async: !1
    }), $.get("../partials/menu-primary.html", "", function(a) {
        $(".menu-primary").append(a);
    }), $.get("../partials/search-box.html", "", function(a) {
        $(".search-form").append(a);
    }), $.get("../partials/slider.html", "", function(a) {
        $(".carousel").append(a);
    }), $.get("../partials/parallax.html", "", function(a) {
        $(".parallax-container").append(a);
    }), $.get("../partials/contact-form.html", "", function(a) {
        $(".contact").append(a);
    }), $.ajaxSetup({
        async: !0
    });
}), $(document).ready(function() {
    $(".slider").slider({
        full_width: !0,
        interval: 5e3,
        transition: 800,
        indicators: !0,
        height: "100%"
    }), $(".parallax").parallax(), $("textarea").characterCounter();
});